        public static void test_withExternalModel()
        {
            ClassifierWrapper wrapper = new ClassifierWrapper();

            wrapper.loadExternalModel(Misc.Config.WEKA.WEKA_EXTERNAL_MODEL);

            wrapper.setUpDatasetManually(Misc.Config.WEKA.LABELS, Misc.Config.WEKA.ATTRIBUTES);

            for (int i = 0; i < data.Length; i++)
                Console.WriteLine(wrapper.classify(data[i], Misc.Config.WEKA.ATTRIBUTE_START_INDEX));

            Console.ReadLine();

        }

        public static void test_withTraining()
        {
            Classifier classifier = new weka.classifiers.lazy.IBk();

            ClassifierWrapper wrapper = new ClassifierWrapper(classifier);

            wrapper.trainClassifierCrossValidation("path/to/file.arff", 10);

            for (int i = 0; i < data.Length; i++)
                Console.WriteLine(wrapper.classify(data[i], 0));

            Console.ReadLine();
        }
    }
